import axios from "axios";

export const ApiLogin = (param)=>{
    return axios.post('http://indoor.lcprojects.net/api/login.php', JSON.stringify('nome:luan', 'senha luan123'), {headers:{'Content-Type':'application/x-www-form-urlencoded', 'Accept':'*/*'}})
}
